inputs.customFunctionJavascriptFunction:
// Get analysis results from iteration
const analyses = $analysisResults || [];

// Get zipFileMetadata from flow state
let zipFileMetadata = $flow.state.zipFileMetadata;
if (!Array.isArray(zipFileMetadata)) {
  zipFileMetadata = $vars.zipFileMetadata || [];
}

// Create evidence summary from metadata
const evidenceSummary = Array.isArray(zipFileMetadata) 
  ? zipFileMetadata.map(item => ({
      filename: item.filename || 'unknown',
      type: item.type || 'unknown',
      contents: item.type || 'unknown',
      metadata: item
    }))
  : [];

// Return data for client-side Word generation
return { 
  evidenceSummary: evidenceSummary,
  analysisResults: analyses 
};

